import './SignUp.css';
import AddPicture from './Addpicture/AddPicture.js';
import Password from './Password/password';
import {checkCredentials, checkCredentials2} from './SignupCheck';
import {Link, useNavigate} from "react-router-dom";
import { useState } from 'react';


async function send(DisplayName,Username,Password,Pic){
    const data ={
        username: Username,
        password: Password,
        displayName: DisplayName,
        profilePic: Pic
    }
   const res = await fetch('http://localhost:5000/api/Users', {
    'method' : 'post',
     'headers' :{
      'Content-type':'application/json',
     },
     'body': JSON.stringify(data)
   })
   console.log(res)
 }

function SignUp() {

    const [uploadedFile, setUploadedFile] = useState(null);

     
    const history = useNavigate();
    const handleSubmit = (event) => {
        event.preventDefault();
        const displayName = document.getElementById('display-name').value;
        const MyUsername = document.getElementById('username').value;
        const Mypassword = document.getElementById('psw').value;
        const repeatPassword = document.getElementById('psw-repeat').value;

        if (Mypassword !== repeatPassword) {
            alert('Passwords do not match!');
            return;
        }

        if (Mypassword.length < 8 || Mypassword.length > 16) {
            alert('Password should be between 8 and 16 characters long!');
            return;
        }

        if (repeatPassword.length < 8 || repeatPassword.length > 16) {
            alert('Password should be between 8 and 16 characters long!');
            return;
        }

        const foundUser = checkCredentials(MyUsername);
        if(foundUser){
            alert('username already taken!');
            return;
        }
        const foundDisplay = checkCredentials2(displayName);
        if(foundDisplay){
            alert('display name already taken!');
            return;
        }
        let newUser = null;
        if (uploadedFile !== null) {
            const reader = new FileReader();
            reader.onloadend = () => {
            newUser = {
                username: MyUsername,
                password: Mypassword,
                display: displayName,
                image: reader.result, // Assign the base64 representation of the file
            };
            users.push(newUser);
            send(displayName, MyUsername, Mypassword, reader.result); // Pass the base64 value to the send function
            history(`/`);
            };
            reader.readAsDataURL(uploadedFile); // Read the file as data URL
        } 
        else {
            // Read "man.png" file and convert it to base64
            fetch('man.png')
                .then((response) => response.blob())
                .then((blob) => {
                    const reader = new FileReader();
                    reader.onloadend = () => {
                    newUser = {
                        username: MyUsername,
                        password: Mypassword,
                        display: displayName,
                        image: reader.result, // Assign the base64 representation of the file
                    };
                    users.push(newUser);
                    send(displayName, MyUsername, Mypassword, reader.result); // Pass the base64 value to the send function
                    history(`/`);
                    };
                    reader.readAsDataURL(blob); // Read the blob as data URL
                });
        }    
    };

    return (
        <form id="myform" onSubmit={handleSubmit}>
            <div className="container">
                <div id="form-header">
                    <h3>Sign up</h3>
                </div>
                <div id="form-body">
                    <p>Username:</p>
                    <div>
                        <i className="bi bi-person-circle" />
                        <input
                            type="text"
                            placeholder="Enter username"
                            name="username"
                            id="username"
                            required
                        />
                    </div>
                    <Password />
                    <p>Display name:</p>
                    <div>
                        <i className="bi bi-person-vcard" />
                        <input
                            type="text"
                            placeholder="Enter display name"
                            name="display"
                            id="display-name"
                            required
                        />
                    </div>

                    <AddPicture id ="pic" uploaded={uploadedFile} setUploaded={setUploadedFile}/>

                </div>

                <div id="form-footer">

                    <button type="submit" className="btn btn-warning" id="register">
                        Register
                    </button>

                    <p>
                        Already have an account? <Link to="/"> Sign in</Link>
                    </p>
                </div>
            </div>
        </form>

    );
}

export default SignUp
